import axios from "axios";

export const getPositionById = (id) => {
    const {API_BASE_URL}= process.env
   return axios.get(`${API_BASE_URL}position/id/${id}`)
    .then((data) => {
        return data
    })
    .catch((error) => console.error(error));
};
